function CourseListComponent() {
    const data ={

        "course" :[
          {
            "coursename":"John"
          },
          {
            "coursename":"Jack"
          },
          {
            "coursename":"Oliver"
          },
        ]
      }

    return (
    <div className="container">
        <h1>Courses Lists</h1>

        <table className="table">
          <thead>
            <tr>
              <td>Course Name</td>
              <td>Delete</td>
            </tr>
          </thead>
          <tbody>
            {data.course.map((item, i) => (
              <tr key={i}>
                <td>{item.coursename}</td>
              </tr>
            ))}
          </tbody>
        </table>

    </div>
    )
}

export default CourseListComponent
